libs.content:
find_program(numdiff_executable names numdiff
    hints ${numdiff_dir} path_suffixes bin
    )

find_library(gsl_library
  names gsl
  hints ${gsl_dir}
  path_suffixes lib${lib_suffix} lib64 lib
  )

find_library(gsl_cblas_library
  names gslcblas cblas refcblas
  hints ${gsl_dir}
  path_suffixes lib${lib_suffix} lib64 lib
  )

find_library(p4est_library_optimized
  names p4est
  hints ${p4est_dir}/fast ${p4est_dir}/debug ${p4est_dir}
  path_suffixes lib${lib_suffix} lib64 lib src
  )

