find_library(arpack_library
  names arpack
  hints ${arpack_dir}
  path_suffixes lib${lib_suffix} lib64 lib
  )

find_library(parpack_library
    names parpack
    hints ${_path} ${arpack_dir} ${parpack_dir}
    path_suffixes lib${lib_suffix} lib64 lib
    )

find_library(trilinos_library_${_library}
      names ${_library}
      hints ${trilinos_library_dirs}
      no_default_path
      no_cmake_environment_path
      no_cmake_path
      no_system_environment_path
      no_cmake_system_path
      no_cmake_find_root_path
      )

find_library(petsc_library
  names petsc libpetsc
  hints ${petsc_dir} ${petsc_dir}/${petsc_arch}
  path_suffixes lib${lib_suffix} lib64 lib
  )

find_library(petsc_library_${_token}
            names ${_token}
            hints ${_hints}
            )

