  names tbb
  hints
    ${_path}
    ${tbb_dir}
  path_suffixes lib${lib_suffix} lib64 lib
  )

find_library(tbb_debug_library
  names tbb_debug
  hints
    ${_path}
    ${tbb_dir}
  path_suffixes lib${lib_suffix} lib64 lib
  )

find_library(assimp_lib names assimp
  hints ${assimp_dir}
  path_suffixes lib${lib_suffix} lib64 lib
  )

find_library(scalapack_library names scalapack scalapack-openmpi scalapack-pvm scalapack-mpi scalapack-mpich scalapack-mpich2 scalapack-lam
  hints ${scalapack_dir}
  path_suffixes lib${lib_suffix} lib64 lib
  )

find_library(opencascade_${_library}
    names ${_library}
    hints ${opencascade_dir}
    path_suffixes lib${lib_suffix} lib64 lib mac64/clang/lib mac32/clang/lib lin64/gcc/lib lin32/gcc/lib
    )

find_library(muparser_library
  names muparser muparserd
  hints ${muparser_dir}
  path_suffixes lib${lib_suffix} lib64 lib
  )

find_library(ginkgo_library_${_library}
      names ${_library}
      hints ${ginkgo_install_library_dir}
      no_default_path
      no_cmake_environment_path
      no_cmake_path
      no_system_environment_path
      no_cmake_system_path
      no_cmake_find_root_path
      )

find_library(${_comp}_library
    names ${_name} lib${_name}
    hints
      ${${_comp_uppercase}_dir}
      ${suitesparse_dir}/${_comp}
      ${umfpack_dir}/../${_comp}
      ${umfpack_dir}/${_comp}
      ${umfpack_dir}
    path_suffixes
    lib${lib_suffix} lib64 lib lib ${_comp}/lib
    )

find_library(gmsh_library
  names gmsh
  hints ${gmsh_library_dir}
  path_suffixes lib${lib_suffix} lib64 lib
  )

find_program(gmsh_exe gmsh${cmake_executable_suffix}
  hints ${gmsh_dir}
  path_suffixes bin
  )

